import html from '../../assets/imagenes/HTML5.png';
import css from '../../assets/imagenes/CSS3.jpg';
import js from '../../assets/imagenes/JS.png';
import bootstrap from '../../assets/imagenes/Bootstrap.jpg';
import react from '../../assets/imagenes/REACT.png';

const skills = [
    {
        image: html,
        alternative: 'HTML5',
        id: 1
    },
    {
        image: css,
        alternative: 'CSS3',
        id: 2
    },
    {
        image: js,
        alternative: 'JS',
        id: 3
    },
    {
        image: bootstrap,
        alternative: 'Bootstrap',
        id: 4
    },
    {
        image: react,
        alternative: 'React',
        id: 5
    }
]

export default skills;
